import React from 'react';
import Galery from 'react-images-viewer';
import coffeeCup from '../images/coffeeCup.jpg';
import coffeeCupWhite from '../images/coffeeCupWhite.jpg';
import coffeeExpress from '../images/coffeeExpress.jpg';
import coffeeFirst from '../images/coffeeFirst.jpg';

export default function Galeries() {
  const imgsList = [
    { srcSet: [coffeeCup, coffeeCupWhite, coffeeExpress, coffeeFirst] }];

  return (
    <div className="galery-container">
      <Galery
        imgs={imgsList}
        tspinnerColor="#d40000"
        spinnerSize={150}
        showThumbnails
      />
    </div>
  );
}
